import { Component } from '@angular/core';
import { DataService } from 'src/app/services/data.service';

@Component({
  selector: 'app-news',
  templateUrl: './news.component.html',
  styleUrls: ['./news.component.scss'],
})
export class NewsComponent {
  public news: any = [];
  constructor(public dataService: DataService) {
    this.getNews();
  }

  ngOnInit() {
    this.news = [
      {
        title: 'News beitr채ge',
        content:
          'Tauche ein in die Welt von Harley-Davidson, wo jedes Detail, jeder Glanzpunkt auf dem Chrom, die pure Freiheit auf zwei R채dern repr채sentiert. #HarleyDavidson #FreiheitAufR채dern',
        image:
          'data:image/jpeg;base64,',
        timestamp: {
          $date: '2024-01-21T20:06:55.766Z',
        },
      },
      {
        title: 'Freiheit in Chrom',
        content:
          'Tauche ein in die Welt von Harley-Davidson, wo jedes Detail, jeder Glanzpunkt auf dem Chrom, die pure Freiheit auf zwei R채dern repr채sentiert. #HarleyDavidson #FreiheitAufR채dern',
        image:
          'data:image/jpeg;base64,',
        timestamp: {
          $date: '2024-01-21T20:06:55.766Z',
        },
      }
    ];
  }

  public getNews() {
    this.dataService.getNews().subscribe((res: any) => {
      if (res.length <= 0 || res.length == undefined) return;
      res.forEach((el: any) => {
        this.news.push(el);
      });
    });
  }
  public formattedDateString(dateString: any) {
    const date = new Date(dateString);

    const options: Intl.DateTimeFormatOptions = {
      day: '2-digit',
      month: '2-digit',
      year: 'numeric',
    };

    const formattedDate = date.toLocaleDateString('en-US', options);
    return formattedDate;
  }
}
